  {
    id: 2,
    title: "Study",
  },

];

const list = [1, 2, 3, 4]

function renderItems(){
  return demots.map((demot) => {
    <p>{demot.title}</p>
  })
}

function App() {
  return (<div>{list.map((ar) => {
    <p></p>
  })}</div>)

